import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <a
            href = "http://localhost:8000?variable={ticker}"
            target="_blank"
            > Today's Stock Price</a>

            <form onSubmit className="search-form">
              <input
                type="text"
                placeholder="Enter search ticker..."
              />
              <div>
                <button href = "http://localhost:8000">Today's Stock Price</button>
              </div>
            </form>
        </header>
      </div>
    );
  }

}

export default App;
